import React from 'react';

export default propriedadesMembros => {

    if(propriedadesMembros.genero){
        const Gener = 'M'
    }else{
        const Gener = 'F'
    }

    return <div>{propriedadesMembros.nome} <strong>{propriedadesMembros.tipo}</strong> Genero: { Gener }</div>
}
